import React from "react";
import JournalDetail from "./JournalDetail";
import { useSelector } from "react-redux";
import { Link, useParams } from "react-router-dom";
const JournalList = () => {
  const listJournal = useSelector(
    (state) => state.journalAppReducer.journalData
  );
  let { id } = useParams();
  console.log(id);

  const handleDetail = () => {
    return listJournal.map((item, index) => {
      return (
        <Link
          to={`/my-journal/${item.id}`}
          className="list-group-item"
          style={{ cursor: "pointer", display: "block" }}
        >
          {item.name}
        </Link>
      );
    });
  };
  return (
    <div>
      <div className="journal-list-wrapper">
        <header>
          <div className="subTitle">Your entries</div>
          <div className="subTitle">Detail</div>
        </header>
      </div>
      <div className="journal-list-main-area">
        <div className="journal-list">
          <ul className="list-group">
            {/* <li>go to the beach</li>

            <li>camping</li>
            <li>go to the concert</li>
            <li>play game</li> */}
            {handleDetail()}
          </ul>
        </div>
        <div className="journal-detail">
          <JournalDetail />
        </div>
      </div>
    </div>
  );
};

export default JournalList;
